package com.bdt.entity;import javax.validation.constraints.NotBlank;import java.io.Serializable;import java.util.Date;public class Operator implements Serializable{        /**     * serialVersionUID     */    private static final long serialVersionUID = 1L;    protected String operator_no;    protected String password;    protected String status;    protected String name;    protected String telephone;    protected String remark;        public String getOperator_no() {        return operator_no;    }        public void setOperator_no(String operator_no) {        this.operator_no = operator_no;    }        public String getPassword() {        return password;    }        public void setPassword(String password) {        this.password = password;    }        public String getStatus() {        return status;    }        public void setStatus(String status) {        this.status = status;    }        public String getName() {        return name;    }        public void setName(String name) {        this.name = name;    }        public String getTelephone() {        return telephone;    }        public void setTelephone(String telephone) {        this.telephone = telephone;    }        public String getRemark() {        return remark;    }        public void setRemark(String remark) {        this.remark = remark;    }            @Override    public String toString() {        StringBuilder builder = new StringBuilder();        builder.append("Operator [operator_no=").append(operator_no)                .append(", password=").append(password)                .append(", status=").append(status)                .append(", name=").append(name)                .append(", telephone=").append(telephone)                .append(", remark=").append(remark)                .append("]");        return builder.toString();    }    }